class DataLoader(object):
    def __init__(self, vehicle_file_path: str, collection_point_file_path: str, parking_file_path: str,
                 dropping_file_path: str, distance_file_path: str):
        """
        Initialize the dataLoader.
        :param vehicle_file_path: The path of the file of vehicle information.
        :param collection_point_file_path: The path of the file of collection information.
        :param parking_file_path: The path of the file of parking information.
        :param dropping_file_path: The path of the file of dropping point information.
        :param distance_file_path: The distance between any two vertexes.
        """
        self.vehicle_data = self.get_vehicle_data(file_path=vehicle_file_path)
        self.collection_data, self.minimum_capacity = self.get_collection_point_data(
            file_path=collection_point_file_path)
        self.parking_data = self.get_parking_data(file_path=parking_file_path)
        self.dropping_data = self.get_dropping_point_data(file_path=dropping_file_path)
        self.all_points = {}
        for p in self.parking_data.keys():
            self.all_points[p] = self.parking_data[p]

        for d in self.dropping_data.keys():
            self.all_points[d] = self.dropping_data[d]

        for c in self.collection_data.keys():
            self.all_points[c] = self.collection_data[c]
        self.distance_matrix, self.position_index_dic, self.index_id_dic, self.dic_length, self.c_neighbor_dic, self.time_matrix = \
            self.get_distance_data(distance_file_path=distance_file_path, threshold=5000)

        self.id_set_dic = {}

        self.id_set_file_path = './data/big_data/id_set2.json'

        self.collection_data_all = None

        # self.big_coll_set, self.small_coll_set = self.classify_collection_point(threshold=500)
        # print(len(self.big_coll_set))
        # print(len(self.small_coll_set))
        # print(len(self.big_coll_set)+len(self.small_coll_set))

    @staticmethod
    def get_data(data_file_path: str):
        """
        Load data from the file -> dict.
        :param data_file_path:
        :return: dict
        """
        f = open(data_file_path, 'r', encoding='UTF-8')
        # data_point = json.load(f)
        # f.close()
        data_point = []
        allline = f.readlines()
        up_bound = len(allline)-1
        count = 0
        for line in allline:
            if count == 0:
                line = line[1:-2]
            elif count == up_bound:
                line = line[:-1]
            else:
                line = line[:-2]
            dic = json.loads(line)
            data_point.append(dic)
            count += 1       
        return data_point

    @staticmethod
    def time_transfer(working_time_list: list):
        """
        Transfer the time as float number.
        :param working_time_list:
        :return:
        """
        float_working_time_list = []
        for element in working_time_list:
            start_time = element[0].split(':')
            start = int(start_time[0]) + int(start_time[1]) / 60
            end_time = element[1].split(':')
            end = int(end_time[0]) + int(end_time[1]) / 60
            float_working_time_list.append((start, end))

        return float_working_time_list

    def get_vehicle_data(self, file_path: str):
        """
        Load vehicle data from the file to the Vehicle object.
        :param file_path:
        :return: dict -> {vehicle_id: vehicle_object, ...}
        """
        vehicle_data = self.get_data(data_file_path=file_path)
        vehicle_dic = {}

        for v in vehicle_data:
            vehicle = Vehicle(vehicle_id=v['id'],
                              parking_id=v['stopId'],
                              car_number=v['no'],
                              max_capacity=float(v['maxCapacity'])*100,
                              speed=12.5,
                              working_time_list=[(0, 8)],
                              current_capacity=int(v['currentCapacity']))
            vehicle_dic[v['id']] = vehicle
        return vehicle_dic

    def get_collection_point_data(self, file_path: str):
        """
        Load collection point data from the file to the Point object.
        :param file_path:
        :return: dict -> {collection_id: collection_object, ...}
        """
        collection_points = self.get_data(data_file_path=file_path)
        collection_points_dic = {}
        minimum_capacity = 10 ** 10

        for c in collection_points:
            collection = Points(point_id=c['id'],
                                lat=int(c['lat'])/(10**6),
                                lng=int(c['lng'])/(10**6),
                                server_cost=float(c['stopLength']),
                                point_capacity=float(c['capacity']),
                                point_type=3,
                                working_time_list=self.time_transfer(list(c['workTimes'])))
            if collection.point_capacity < minimum_capacity:
                minimum_capacity = collection.point_capacity
            collection_points_dic[c['id']] = collection
        return collection_points_dic, minimum_capacity

    def get_parking_data(self, file_path: str):
        """
        Load parking data from the file to the Point object.
        :param file_path:
        :return:
        """
        parking_points = self.get_data(data_file_path=file_path)
        parking_dic = {}

        for p in parking_points:
            parking = Points(point_id=p['id'],
                             lat=int(p['lat'])/(10**6),
                             lng=int(p['lng'])/(10**6),
                             server_cost=0,
                             point_capacity=sys.maxsize,
                             point_type=2,
                             working_time_list=[(0, 24)],
                             name=p['name'])
            parking_dic[p['id']] = parking
        return parking_dic

    def get_dropping_point_data(self, file_path: str):
        """
        Load dropping point data from the file to the Point object.
        :param file_path:
        :return:
        """
        dropping_points = self.get_data(data_file_path=file_path)
        dropping_dic = {}

        for d in dropping_points:
            dropping = Points(point_id=d['id'],
                              lat=int(d['lat'])/(10**6),
                              lng=int(d['lng'])/(10**6),
                              server_cost=0,
                              point_capacity=sys.maxsize,
                              point_type=4,
                              working_time_list=[(0, 24)],
                              name=d['name'])
            dropping_dic[d['id']] = dropping

        return dropping_dic

    def get_position_index_dic(self):
        """
        Get id-index dict and index-id dict.
        :return: position_index_dic -> dict: {point_id: index}
                 index_id_dic -> dict: {index, point_id}
                 index: the length of the dict
        """
        position_index_dic = {}
        index_id_dic = {}
        index = 0
        for c_key in self.collection_data.keys():
            position_index_dic[c_key] = index
            index_id_dic[index] = c_key
            index += 1
        for d_key in self.dropping_data.keys():
            position_index_dic[d_key] = index
            index_id_dic[index] = d_key
            index += 1
        for p_key in self.parking_data.keys():
            position_index_dic[p_key] = index
            index_id_dic[index] = p_key
            index += 1

        return position_index_dic, index, index_id_dic

    def get_distance_data(self, distance_file_path: str, threshold: float):
        """
        Get distance between any two points.
        :param distance_file_path:
        :param threshold: The threshold of the c_neighbor_dic
        :return:distance_matrix -> np.matrix: a matrix to store the distance between any two points;
                position_index_dic -> dict: {point_id: index}
                index_id_dic -> dict: {index, point_id}
        """
        position_index_dic, dic_length, index_id_dic = self.get_position_index_dic()
        distance_matrix = np.zeros((dic_length, dic_length))
        c_neighbor_dic = {}
        p_list = list(self.parking_data.keys())
        d_list = list(self.dropping_data.keys())
        p_d_list = p_list + d_list
        index = 0
        with open(distance_file_path, 'r', encoding='UTF-8') as f:
            f_csv = csv.reader(f)
            for dist in f_csv:
                if index == 0:
                    index += 1
                else:
                    start_id, end_id, distance = dist[0], dist[1], dist[2]
                    distance = float(distance)
                    if start_id not in p_d_list and end_id not in p_d_list:
                        if distance <= threshold:
                            result = c_neighbor_dic.get(start_id)
                            if result is None:
                                c_neighbor_dic[start_id] = [end_id]
                            else:
                                c_neighbor_dic[start_id].append(end_id)
                    distance_matrix[position_index_dic[start_id], position_index_dic[end_id]] = distance
                    index += 1
        special_point = '5adedf3f5e27e51c0e794116'
        original_point = '5adedf3f5e27e51c0e794115'
        for key in self.all_points.keys():
            if key != special_point:
                distance_matrix[position_index_dic[special_point], position_index_dic[key]] = \
                    distance_matrix[position_index_dic[original_point], position_index_dic[key]]
                distance_matrix[position_index_dic[key], position_index_dic[special_point]] = \
                    distance_matrix[position_index_dic[key], position_index_dic[original_point]]
        
        time_matrix = np.array([[distance_matrix[i][j]/45000 for j in range(len(distance_matrix[i]))] for i in range(len(distance_matrix))])
        return distance_matrix, position_index_dic, index_id_dic, dic_length, c_neighbor_dic, time_matrix

    def classify_collection_point(self, threshold):
        """
        Classify the collection points in two class.
        :param threshold: The distance threshold which is used to classify the collection points.
        :return: big_difference_set: set -> the distance difference between a->b and b->a is bigger than threshold.
                 small_difference_set: set -> the distance difference between a->b and b->a is smaller than threshold.
        """
        small_difference_set = set()
        big_difference_set = set()

        num = 0
        num2 = 0
        collection_num = len(self.collection_data)
        collection_list = list(range(collection_num))
        for c_pair in itertools.combinations(collection_list, 2):
            i = c_pair[0]
            j = c_pair[1]
            difference = abs(self.distance_matrix[i][j]-self.distance_matrix[j][i])
            if difference <= threshold:
                small_difference_set.add((i, j))
                num2 += 1
            else:
                big_difference_set.add((i, j))
                big_difference_set.add((j, i))
            num += 1
        print("num = {}, num2 = {}".format(num, num2))
        return big_difference_set, small_difference_set

    def get_total_distance(self, solution_route_dic: dict):
        """
        Compute total distance cost for each vehicle and route planning.
        :param solution_route_dic: dict -> the dictionary of the solution route
        :return: distance_dic: dict -> {vehicle_id: distance, ...}
                 total_distance: float -> the total distance cost of the route planning.
        """
        distance_dic = {}
        total_distance = 0
        for v_id in solution_route_dic.keys():
            distance = 0
            route_list = solution_route_dic[v_id]
            for single_route in route_list:
                for i in range(1, len(single_route)):
                    start = single_route[i - 1]
                    end = single_route[i]
                    distance += self.distance_matrix[self.position_index_dic[start]][
                        self.position_index_dic[end]]
            distance_dic[v_id] = distance
            total_distance += distance
        # print(distance_dic)
        # print(total_distance)
        return distance_dic, total_distance

    def get_route_distance(self, single_route: list):
        """
        Compute total distance cost for a single route.
        :param single_route: list -> the list of the point
        :return: total_distance: float -> the total distance cost of the route planning.
        """
        total_distance = 0

        for i in range(1, len(single_route)):
            start = single_route[i - 1]
            end = single_route[i]
            total_distance += self.distance_matrix[self.position_index_dic[start]][self.position_index_dic[end]]
        # print(distance_dic)
        # print(total_distance)
        return total_distance

    @staticmethod
    def combine_collection_points(file_path: str):
        """
        Merge the small collection points into big collection point according to the street name and concrete address of
        the collection points.
        :param file_path: The path of the file which stores the address
        :return: address_id_dic: dict -> {address: the set of ids, ...}
        """
        address_id_dic = {}
        index = 0
        with open(file_path, 'r') as f:
            f_csv = csv.reader(f)
            for element in f_csv:
                if index == 0:
                    index += 1
                else:
                    index += 1
                    street_name = element[4]
                    concrete_address = element[3]
                    if street_name == '[]':
                        value = address_id_dic.get(concrete_address)
                        if value is None:
                            address_id_dic[concrete_address] = {element[0]}
                        else:
                            address_id_dic[concrete_address].add(element[0])
                    else:
                        value = address_id_dic.get(street_name)
                        if value is None:
                            address_id_dic[street_name] = {element[0]}
                        else:
                            address_id_dic[street_name].add(element[0])
        return address_id_dic

    def get_small_dataset(self, address_id_dic: dict, save_file_path: str):
        """
        Save the collection point merge result into the file.
        :param address_id_dic: The dictionary is likes this {address: the ids of the collection points}
        :param save_file_path: The file path.
        :return:
        """
        all_data_length = 0
        headers = ['id', 'capacity', 'num_collection_point']
        with open(save_file_path, 'w', newline='', encoding='UTF-8') as f:
            f_csv = csv.writer(f)
            f_csv.writerow(headers)
            for key in address_id_dic.keys():
                all_data_length += len(address_id_dic[key])
                total_capacity = 0
                for element in address_id_dic[key]:
                    total_capacity += self.collection_data[element].point_capacity
                row = [list(address_id_dic[key])[0], total_capacity, len(address_id_dic[key])]
                f_csv.writerow(row)
        print(all_data_length)

    def merge_collection_points_with_threshold(self, address_id_dic: dict, threshold: int, save_file_path: str):
        """
        Merge close collection points to be big collection points.
        :param address_id_dic: dict -> {address: a set of collection point id with can be merge}
        :param threshold: the largest capacity of the big collection point
        :param save_file_path: the save path the result
        :return:
        """
        headers = ['id', 'capacity', 'num_collection_point', 'server_time']
        total_num = 0

        with open(save_file_path, 'w', encoding='UTF-8', newline='') as f:
            f_csv = csv.writer(f)
            f_csv.writerow(headers)

            for key in address_id_dic.keys():
                total_capacity = 0
                server_time = 0
                num = 0
                key_id = None
                for c_id in address_id_dic[key]:
                    total_capacity += self.collection_data[c_id].point_capacity
                    server_time += self.collection_data[c_id].server_cost
                    if key_id is None:
                        key_id = copy.deepcopy(c_id)
                    result = self.id_set_dic.get(key_id)
                    if result is None:
                        self.id_set_dic[key_id] = [copy.deepcopy(c_id)]
                    else:
                        self.id_set_dic[key_id].append(copy.deepcopy(c_id))
                    num += 1
                    if total_capacity > threshold and num > 1:
                        total_capacity -= self.collection_data[c_id].point_capacity
                        server_time -= self.collection_data[c_id].server_cost
                        self.id_set_dic[key_id].remove(c_id)
                        row = [key_id, total_capacity, num-1, server_time]
                        if total_capacity == 0:
                            print(row)
                        f_csv.writerow(row)
                        total_capacity = self.collection_data[c_id].point_capacity
                        total_num += (num-1)
                        num = 1
                        key_id = copy.deepcopy(c_id)
                        self.id_set_dic[key_id] = [copy.deepcopy(c_id)]
                        server_time = self.collection_data[c_id].server_cost
                    elif total_capacity > threshold and num == 1:
                        row = [key_id, total_capacity, num, server_time]
                        f_csv.writerow(row)
                        key_id = None
                        server_time = 0
                        num = 0
                        total_capacity = 0
                if total_capacity > 0:
                    row = [key_id, total_capacity, num, server_time]
                    f_csv.writerow(row)
                    total_num += num
            # print(self.id_set_dic)
            point_num = 0
            for key in self.id_set_dic:
                point_num += len(self.id_set_dic[key])
            print('len of id_set_dic = {}'.format(len(self.id_set_dic)))
            print('point num in self.id_set_dic = {}'.format(point_num))
            with open(self.id_set_file_path, 'w', encoding='UTF-8') as f:
                json.dump(self.id_set_dic, f)
            print("total_num = {}".format(total_num))

    def classify_parts(self, file_path: str):
        """
        Classify the collection point to num of parking parts according to the distance between collection point and parking.
        :param file_path: the path of the big collection point data
        :return:
        """
        parking_id_dic = {}
        merge_collection_point = {}
        for p_id in self.parking_data.keys():
            parking_id_dic[p_id] = set()

        index = 0
        with open(file_path, 'r') as f:
            f_csv = csv.reader(f)
            for element in f_csv:
                if index == 0:
                    index += 1
                else:
                    index += 1
                    c_id = element[0]
                    capacity = float(element[1])
                    time_cost = float(element[3])
                    merge_collection_point[c_id] = self.collection_data[c_id]
                    merge_collection_point[c_id].point_capacity = capacity
                    merge_collection_point[c_id].server_cost = time_cost

                    minimum_dist = 10 ** 10
                    own_parking = ''
                    for p_id in parking_id_dic.keys():
                        distance = self.distance_matrix[self.position_index_dic[p_id]][self.position_index_dic[c_id]]
                        distance2 = self.distance_matrix[self.position_index_dic[c_id]][self.position_index_dic[p_id]]
                        distance = (distance+distance2)/2
                        if distance < minimum_dist:
                            minimum_dist = distance
                            own_parking = p_id
                    parking_id_dic[own_parking].add(c_id)
        print(index)
        print('len of collection point = {}'.format(len(self.collection_data)))
        self.collection_data_all = copy.deepcopy(self.collection_data)
        self.collection_data = merge_collection_point
        return parking_id_dic, merge_collection_point

